(window.webpackJsonp=window.webpackJsonp||[]).push([[157],{"./src/Project/ImplementationOverview/ReadOnlyImplementationOverview.html":function(n,e){n.exports='<div class="project-section section-strategy read-only" md-whiteframe="2">\n  <div class="section-title md-title">\n    <translate>2. Implementation overview</translate>\n    <span class="toggler" ng-click="vm.collapse()"><i class="material-icons">keyboard_arrow_down</i></span>\n  </div>\n\n  <div class="section-wrapper">\n    <h6>\n      <translate>Add one or more Software and related Digital Health Interventions (DHI):</translate>\n    </h6>\n\n    <div class="input-group" ng-repeat="platform in vm.project.platforms">\n      <div class="extra-margin">\n        <h6>\n          <translate>Software</translate>\n        </h6>\n        <p>{{platform.name}}</p>\n      </div>\n      <div>\n        <h6>\n          <translate>Digital Health Interventions</translate>\n        </h6>\n        <div layout="row">\n          <ul>\n            <li ng-repeat="s in platform.strategies">{{s.name}}</li>\n          </ul>\n        </div>\n      </div>\n    </div>\n  </div>\n\n  <div class="section-wrapper">\n\n    <h6>\n      <translate>Health focus area(s)</translate>\n    </h6>\n\n    <div>\n      <ul>\n        <li ng-repeat="hf in vm.project.health_focus_areas">{{hf.name}}</li>\n      </ul>\n    </div>\n\n    <h6>\n      <translate>What are the Health System Challenges (HSC) your project addresses?</translate>\n    </h6>\n\n    <div>\n      <ul>\n        <li ng-repeat="hsc in vm.project.hsc_challenges">{{hsc.challenge}}</li>\n      </ul>\n    </div>\n\n    <h6>\n      <translate>What part(s) of the Health Information System (HIS) does this project support?</translate>\n    </h6>\n\n    <div>\n      <ul>\n        <li ng-repeat="his in vm.project.his_bucket">{{his.name}}</li>\n      </ul>\n    </div>\n\n    <h6>\n      <translate>What kind of coverage does your project have?</translate>\n    </h6>\n\n    <div>\n      <div layout="column">\n        <span ng-show="vm.project.coverageType === 1">\n          <translate>Sub-national</translate>\n        </span>\n        <span ng-show="vm.project.coverageType === 2">\n          <translate>National</translate>\n        </span>\n      </div>\n    </div>\n\n    <div ng-show="vm.project.coverageType === 1">\n      <h6 class="subtitle"><i class="material-icons">&#xE567;</i>\n        <translate> {{vm.subLevelNames[0]}} level deployment</translate>\n      </h6>\n\n      <div class="input-group" ng-repeat="cov in vm.project.coverage">\n        <div layout="column">\n          <div layout="row">\n            <div class="district" flex="50">\n              <h6 class="text-capitalize">\n                {{vm.subLevelNames[0]}}\n              </h6>\n              <p>{{cov.district}}</p>\n            </div>\n            <div flex="50"></div>\n          </div>\n          <div layout="row">\n            <div class="number" flex="20">\n              <h6>\n                <translate># Health Workers</translate>\n              </h6>\n              <p>{{cov.health_workers}}</p>\n            </div>\n            <div class="number" flex="20">\n              <h6>\n                <translate># Facilities</translate>\n              </h6>\n              <p>{{cov.facilities}}</p>\n            </div>\n            <div class="number" flex="20">\n              <h6>\n                <translate># Clients</translate>\n              </h6>\n              <p>{{cov.clients}}</p>\n            </div>\n          </div>\n        </div>\n      </div>\n\n      <h6 class="subtitle" ng-show="vm.project.coverage_second_level && vm.project.coverage_second_level.length > 0">\n        <i class="material-icons">&#xE567;</i>\n        <translate> {{vm.subLevelNames[1]}} level deployment</translate>\n      </h6>\n      <div class="input-group" ng-repeat="cov in vm.project.coverage_second_level">\n        <div layout="column">\n          <div layout="row">\n            <div class="district" flex="50">\n              <h6 class="text-capitalize">\n                {{vm.subLevelNames[1]}}\n              </h6>\n              <p>{{cov.district}}</p>\n            </div>\n            <div flex="50"></div>\n          </div>\n          <div layout="row">\n            <div class="number" flex="20">\n              <h6>\n                <translate># Health Workers</translate>\n              </h6>\n              <p>{{cov.health_workers}}</p>\n            </div>\n            <div class="number" flex="20">\n              <h6>\n                <translate># Facilities</translate>\n              </h6>\n              <p>{{cov.facilities}}</p>\n            </div>\n            <div class="number" flex="20">\n              <h6>\n                <translate># Clients</translate>\n              </h6>\n              <p>{{cov.clients}}</p>\n            </div>\n          </div>\n        </div>\n      </div>\n    </div>\n\n    <div ng-show="vm.project.coverageType === 2">\n      <h6 class="subtitle"><i class="material-icons">&#xE153;</i>\n        <translate>National level deployment</translate>\n      </h6>\n\n      <div class="input-group">\n        <div layout="row">\n          <div class="number" flex="20">\n            <h6>\n              <translate># Health Workers</translate>\n            </h6>\n            <p>{{vm.project.national_level_deployment.health_workers}}</p>\n          </div>\n          <div class="number" flex="20">\n            <h6>\n              <translate># Facilities</translate>\n            </h6>\n            <p>{{vm.project.national_level_deployment.facilities}}</p>\n          </div>\n          <div class="number" flex="20">\n            <h6>\n              <translate># Clients</translate>\n            </h6>\n            <p>{{vm.project.national_level_deployment.clients}}</p>\n          </div>\n          <div flex="40"></div>\n        </div>\n      </div>\n    </div>\n\n    <h6>\n      <translate>Has the government financially invested in the project?</translate>\n    </h6>\n\n    <div>\n      <p ng-show="vm.project.government_investor === 0">\n        <translate>No, they have not yet contributed</translate>\n      </p>\n      <p ng-show="vm.project.government_investor === 1">\n        <translate>Yes, they are contributing in-kind people or time</translate>\n      </p>\n      <p ng-show="vm.project.government_investor === 2">\n        <translate>Yes, there is a financial contribution through MOH budget</translate>\n      </p>\n    </div>\n\n    <h6>\n      <translate>Implementing partners</translate>\n    </h6>\n\n    <div>\n      <ul>\n        <li ng-repeat="partner in vm.project.implementing_partners">{{partner}}</li>\n      </ul>\n    </div>\n\n    <h6>\n      <translate>Donors</translate>\n    </h6>\n\n    <div>\n      <ul>\n        <li ng-repeat="donor in vm.project.donors">{{donor}}</li>\n      </ul>\n    </div>\n\n  </div>\n</div>\n'}}]);